    public class CustomAdapter extends ArrayAdapter<DataType>{

        public CustomAdapter(Context context, ArrayList<DataType> items){
            super(context, 0, items);
        }

        //We override the getView method so that we can provide our own view
        //for each item in the list
        @NonNull
        @Override
        public View getView(int position,
                            @Nullable View convertView,
                            @NonNull ViewGroup parent) {
            //We do this by checking if the item already has a view
            //and if it does not we provide it with one
            if(convertView == null){
                //provide the item with the custom view we made
                convertView = LayoutInflater.from(getContext())
                        .inflate(R.layout.item_view, parent, false);
            }
            TextView name = convertView.findViewById(R.id.name);
            DataType item = getItem(position);
            name.setText(item.getName());
            ImageView imageView =
                    convertView.findViewById(R.id.image);
//            imageView.setOnClickListener(new View.OnClickListener() {
//                @Override
//                public void onClick(View v) {
//                    System.out.println("ImageView: I was clicked" + item.getDefinition());
//                }
//            });
            return convertView;
        }
    }



